import React from "react";
import styled from "styled-components";

const WrapperBottomSection = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
`;

const Title = styled.h2``;

const WrapperSolutions = styled.div``;

const ImgSolution = styled.img``;

const WrapperInfo = styled.div`
	display: flex;
	flex-direction: column;
`;

const TitleInfo = styled.h3``;

const TextInfo = styled.p``;

const WrapperLink = styled.div``;

const ImgArrow = styled.img``;

const Anchor = styled.a``;

class Develop extends React.Component {
	render() {
		return (
			<WrapperBottomSection>
				<Title>One product, three solutions</Title>
				<WrapperSolutions>
					<ImgSolution src="/" />
					<WrapperInfo>
						<TitleInfo>Roadmap to succes</TitleInfo>
						<TextInfo>
							Lorem Ipsum is simply dummy text of the printing and typesetting
							industry. Lorem Ipsum has been the industry's standard dummy text
							ever since the 1500s, when an unknown printer took a galley of
							type and scrambled it to make a type specimen book.
						</TextInfo>
						<WrapperLink>
							<ImgArrow src="/" />
							<Anchor>Learn more</Anchor>
						</WrapperLink>
					</WrapperInfo>
				</WrapperSolutions>
			</WrapperBottomSection>
		);
	}
}

export default Develop;
